import React from 'react'
import './header.css'

const Header = (props) => {
  return (
    <header>

    <div className="logo">
        <a href="">{props.data}</a>
    </div>
    <nav>
      {
        props.links.lenght>0 ? props.links.map((url,index)=>{
          return(
            <a key={index} href="http://">{url}</a>
          )
      }) : 'No data ....'
      }
    </nav>
    </header>
  )
}

export default Header
